import React from 'react';
import styled from 'styled-components';

const HeaderWrap = styled.div`
  display: flex;
  justify-content: space-between;
  background-color: #313131;
  h1 {
    margin: .5rem 1rem .5rem 1.5rem;
  }
  ul {
    margin-right: 1rem;
    list-style: none;
    display: flex;
    li {
      margin-left: 2rem;
    }
  }
`;

function Header() {
  return (
    <NavWrap>
      <h1>NASA</h1>
      <ul>
        <li>Home</li>
        <li>Explore</li>
        <li>Login</li>
      </ul>
    </NavWrap>
  );
}

export default Header;
